import styles from "./UserForm.module.css"
import Button from "./Button"

const UserForm = ( props ) =>
{
    return(
         <form>
             <div className={`${styles["form-control"]}`}>
                <label>Username</label>
                <input></input>
                <label>Age</label>
                <input></input>
             </div>
             <Button></Button>
        </form>
    );
}

export default UserForm;
